import React, { useState } from "react";
import {
  FaHiking,
  FaCity,
  FaLandmark,
  FaSpa,
  FaUmbrellaBeach,
  FaGift,
  FaCampground,
  FaUsers,
} from "react-icons/fa";

function Activities() {
  // State to track the selected activity type
  const [selectedActivity, setSelectedActivity] = useState(null);

  // Content for each activity type
  const activityContent = {
    outdoor: <p>Here are some great outdoor activities to explore.</p>,
    "city-tours": <p>Explore the best city tours in Morocco.</p>,
    cultural: <p>Discover cultural and thematic tours in Morocco.</p>,
    luxury: <p>Indulge in luxurious tours for a premium experience.</p>,
    family: <p>Family-friendly tours perfect for all ages.</p>,
    relaxation: <p>Relaxation tours to unwind and rejuvenate.</p>,
    holiday: <p>Special holiday and seasonal tours for celebrations.</p>,
    adventure: <p>Wild and adventure tours for thrill-seekers.</p>,
  };

  return (
    <div className="bg-white rounded-lg p-4 px-20 flex flex-col justify-between mb-10">
      <h2 className="text-3xl font-bold text-gray-700 italic mb-6 flex items-center">
        <span className="text-blue-600 mr-4">ðŸ§­</span> Browse Tours By Activity
      </h2>

      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-4 text-lg">
        {/* Links for each activity type */}
        <button
          onClick={() => setSelectedActivity("outdoor")}
          className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200"
        >
          <FaHiking className="text-blue-500" /> Outdoor Activities
        </button>

        <button
          onClick={() => setSelectedActivity("city-tours")}
          className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200"
        >
          <FaCity className="text-blue-500" /> City Tours
        </button>

        <button
          onClick={() => setSelectedActivity("cultural")}
          className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200"
        >
          <FaLandmark className="text-blue-500" /> Cultural & Thematic Tours
        </button>

        <button
          onClick={() => setSelectedActivity("luxury")}
          className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200"
        >
          <FaSpa className="text-blue-500" /> Indulgence & Luxury Tours
        </button>

        <button
          onClick={() => setSelectedActivity("family")}
          className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200"
        >
          <FaUsers className="text-blue-500" /> Family Friendly Tours
        </button>

        <button
          onClick={() => setSelectedActivity("relaxation")}
          className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200"
        >
          <FaUmbrellaBeach className="text-blue-500" /> Relaxation Tours
        </button>

        <button
          onClick={() => setSelectedActivity("holiday")}
          className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200"
        >
          <FaGift className="text-blue-500" /> Holiday & Seasonal Tours
        </button>

        <button
          onClick={() => setSelectedActivity("adventure")}
          className="flex items-center gap-3 text-gray-700 hover:text-blue-600 transition duration-200"
        >
          <FaCampground className="text-blue-500" /> Wild & Adventure Tours
        </button>
      </div>

      {/* Conditionally render the content based on selected activity */}
      <div className="mt-6">
        {selectedActivity && (
          <div className="p-4 bg-gray-100 rounded-lg">
            <h3 className="text-2xl font-semibold text-gray-700">
              {selectedActivity.charAt(0).toUpperCase() + selectedActivity.slice(1)} Tours
            </h3>
            {activityContent[selectedActivity]}
          </div>
        )}
      </div>
    </div>
  );
}

export default Activities;
